import React from 'react';
import { Text, View, StyleSheet, ScrollView, SafeAreaView, Button, Modal } from 'react-native';
import Boards from '../components/Boards'
import AddBoards from '../screens/AddBoard'

const handlebtnAddBoards = () => {
    return (<AddBoards />);
}

function HomeScreen({ navigation }) {
    return (
      <View style={{height:'100%', flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text style={{ fontSize: 30 }}>This is the home screen!</Text>
        <Button
          onPress={() => navigation.navigate('MyModal')}
          title="Open Modal"
        />
      </View>
    );
  }
  
  function ModalScreen({ navigation }) {
    return (
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <Text style={{ fontSize: 30 }}>This is a modal!</Text>
        <Button onPress={() => navigation.goBack()} title="Dismiss" />
      </View>
    );
  }
  
  function DetailsScreen() {
    return (
      <View>
        <Text>Details</Text>
      </View>
    );
  }
  
  const MainStack = createStackNavigator();
  const RootStack = createStackNavigator();
  
  function MainStackScreen() {
    return (
      <MainStack.Navigator>
        <MainStack.Screen name="Home" component={HomeScreen} />
        <MainStack.Screen name="Details" component={DetailsScreen} />
      </MainStack.Navigator>
    );
  }

  
const ListBoard = () => {
    return (
        <NavigationContainer independent={true}>
            <RootStack.Navigator mode="modal" headerMode="none">
                <RootStack.Screen name="Main" component={MainStackScreen} />
                <RootStack.Screen name="MyModal" component={ModalScreen} />
            </RootStack.Navigator>
        </NavigationContainer>
    );
}


const styles = StyleSheet.create({
    container: {
        flex: 1,
    },

});
export default ListBoard

